import React from 'react';
import styling from './CSS/NavBar.css';

export const NavBar = (props) => {
    const reset = () => {
        var button = document.getElementsByClassName('press');
        button.style.animation = 'none';
        button.style.animation = '';
    }
    return (
        <div>
            <button className="press" onCLick={reset}><label>Press me</label></button>
        </div>
    );
}
